import './App.css';
import React from "react";
import SomeInformation from "./components/SomeInformation.js";
import DayPlan from "./components/DayPlan.js";
import Person from "./components/Person.js";
import TextAndDateInformation from "./components/TextAndDateInformation.js";
import {Route, Router} from "react-router";
import {Link} from "react-router-dom";


function App() {
    return (

        <Router>
            <div className="page">
                <nav>
                    <ul>
                        <li>
                            <Link to="">Some Information</Link>
                        </li>
                        <li>
                            <Link to="text-and-date">Text and Date Information</Link>
                        </li>
                        <li>
                            <Link to="day-plan">Day Plan</Link>
                        </li>
                        <li>
                            <Link to="person">Person</Link>
                        </li>
                    </ul>
                </nav>

                <Route path="" exact component={SomeInformation} />
                <Route path="text-and-date" component={TextAndDateInformation} />
                <Route path="day-plan" component={DayPlan} />
                <Route path="person" component={Person} />
            </div>
        </Router>

    );
}

export default App;
